create temp table pet_cemetery_id AS
select id, cemetery_id
from cemetery_geometries cg
where cg.id_iip_identifier in (
    'PL.PZGiK.308.BDOT10k_2EBDCB57-5C27-932F-E053-CA2BA8C08B15',
    'PL.PZGiK.330.BDOT10k_4db64d5b-7016-41d7-8977-df4e23bf99c1',
    'PL.PZGiK.337.BDOT10k_276596F3-A749-332E-E053-CA2BA8C08151'
);

delete
from cemetery_geometries
where id in (
        select id
        from pet_cemetery_id
);

delete
from cemeteries c
where id in (
        select cemetery_id
        from pet_cemetery_id
);

