create temp table first_level_join_temp AS
select c.id as cemetery_id, cg.id_iip_identifier
from cemeteries c
join cemetery_geometries cg on(cg.cemetery_id=c.id);

create temp table second_level_join_temp AS
select c.id as cemetery_id, gcg2.id_iip
from cemeteries c
join cemetery_geometries cg on(cg.cemetery_id=c.id)
join gugik_cemetery_geometries gcg on (gcg.id_iip like cg.id_iip_identifier || '%')
join gugik_cemetery_geometries gcg2 on (gcg2.cemetery_id = gcg.cemetery_id);

create temp table cemetery_names_temp AS
select fljt.cemetery_id, ccd.name, ccd.description
from first_level_join_temp fljt
join cemetery_custom_description ccd on ccd.identifier  != '' and fljt.id_iip_identifier = ccd.identifier;

insert into cemetery_names_temp
select sljt.cemetery_id, ccd.name, ccd.description
from second_level_join_temp sljt
join cemetery_custom_description ccd on ccd.identifier  != '' and sljt.id_iip like ccd.identifier || '%';

update cemeteries
set name = names.name, description = names.description
from cemetery_names_temp as names
where cemeteries.id=names.cemetery_id;

create temp table lost_cemetery_description (
        id varchar not null,
        name varchar,
        description varchar
);

