update cemeteries
set name = names.name, description = names.description
from (
    select cg.cemetery_id, descriptions.name, descriptions.description
    from lost_cemetery_description descriptions
    join cemetery_geometries cg on cg.id_iip_identifier=descriptions.id
) as names
where cemeteries.id=names.cemetery_id;